    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge, Lostwood National Wildlife Refuge, Lake Ilo National Wildlife Refuge,
    and Easement Refuges - District IV and IVa outlines Refuge accomplishments from
    May through August of 1958. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, raptors, fish, reptiles, and disease- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and wildfires.
    Resource management is outlined; topics include grazing and haying. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
